import React from "react";

const Chart = ({ data }) => {
  return (
    <div className="w-100 h-100 pl-5 pt-2">
      <h1>{data.title}</h1>
      <div>
        {data.items.map((x, i) => {
          return (
            <div className={`h-14 my-2 d-flex`}>
              {x.image ? (
                <div style={{ width: "30px", height: "30px" }}>
                  <img src={x.image} className="img-fluid"></img>
                </div>
              ) : (
                <div>{x.name}</div>
              )}

              <div className={`w-${(i + 1) * 20} bg-primary h-100 ml-2`}></div>
            </div>
          );
        })}
      </div>
      <div>
        {data.items.map((x, i) => {
          return (
            <div className={`h-14 my-2 d-flex`}>
              {x.image ? (
                <div style={{ width: "30px", height: "30px" }}>
                  <img src={x.image} className="img-fluid"></img>
                </div>
              ) : (
                <div>{x.name}</div>
              )}

              <div className={`w-${(i + 1) * 20} bg-primary h-100 ml-2`}></div>
            </div>
          );
        })}
      </div>
    </div>
  );
};

export default Chart;
